import React from "react";


function NavBar(){
    return (
    <div className="navbar flex justify-between bg-[#18122B]">
        {/* my logo  */}
        <div className="navCon">Hello! here navbar will come.</div>

        {/* other contents like home,about  */}
        <div className="flex mr-5 ml-5 m-[15px,25px,15px,25px]">
            <div>HOME</div>
            <div>ABOUT</div>
            <div>SKILLS</div>
            <div>PROJECTS</div>
            <div>CONNECT</div>
        </div>
    </div>);
}
export default NavBar;
